import React, { useState } from 'react';

const NutritionPage = () => {
    const [activeTab, setActiveTab] = useState('plan');

    const nutritionTips = [
        "Mantén una hidratación constante durante el día",
        "Prioriza proteínas magras en cada comida",
        "Incluye grasas saludables en tu dieta",
        "Consume carbohidratos complejos antes del entrenamiento",
        "No te saltes el desayuno",
        "Planifica tus comidas con anticipación",
        "Mantén un registro de tu ingesta calórica",
        "Incluye vegetales en cada comida"
    ];

    const mealPlan = {
        "Desayuno": [
            "Avena con proteína y frutas",
            "Huevos revueltos con pan integral",
            "Batido de proteína con frutas"
        ],
        "Almuerzo": [
            "Pechuga de pollo con arroz y vegetales",
            "Pescado con ensalada y quinoa",
            "Carne magra con batata y vegetales"
        ],
        "Cena": [
            "Proteína con ensalada",
            "Salmón con vegetales al vapor",
            "Tofu con arroz integral"
        ],
        "Snacks": [
            "Yogur griego con frutas",
            "Mix de frutos secos",
            "Batido de proteína"
        ]
    };

    return (
        <div className="min-h-screen bg-black text-white p-4 pb-20">
            <div className="max-w-sm mx-auto">
                <h1 className="text-2xl font-bold text-yellow-500 mb-6">Nutrición</h1>

                {/* Tabs de navegación */}
                <div className="flex space-x-2 mb-6">
                    <button
                        onClick={() => setActiveTab('plan')}
                        className={`flex-1 py-2 px-4 rounded-lg ${
                            activeTab === 'plan' 
                            ? 'bg-yellow-500 text-black' 
                            : 'bg-gray-800 text-gray-300'
                        }`}
                    >
                        Plan
                    </button>
                    <button
                        onClick={() => setActiveTab('calorias')}
                        className={`flex-1 py-2 px-4 rounded-lg ${
                            activeTab === 'calorias' 
                            ? 'bg-yellow-500 text-black' 
                            : 'bg-gray-800 text-gray-300'
                        }`}
                    >
                        Calorías
                    </button>
                    <button
                        onClick={() => setActiveTab('tips')}
                        className={`flex-1 py-2 px-4 rounded-lg ${
                            activeTab === 'tips' 
                            ? 'bg-yellow-500 text-black' 
                            : 'bg-gray-800 text-gray-300'
                        }`}
                    >
                        Tips
                    </button>
                </div>

                {/* Contenido de las tabs */}
                <div className="space-y-6">
                    {activeTab === 'plan' && (
                        <div className="space-y-4">
                            {Object.entries(mealPlan).map(([meal, options]) => (
                                <div key={meal} className="bg-gray-800 rounded-xl p-4">
                                    <h3 className="text-yellow-500 font-semibold mb-2">{meal}</h3>
                                    <ul className="space-y-2">
                                        {options.map((option, index) => (
                                            <li key={index} className="text-gray-300">
                                                • {option}
                                            </li>
                                        ))}
                                    </ul>
                                </div>
                            ))}
                        </div>
                    )}

                    {activeTab === 'calorias' && (
                        <div className="bg-gray-800 rounded-xl p-4">
                            <h3 className="text-yellow-500 font-semibold mb-4">Seguimiento de Calorías</h3>
                            <div className="space-y-4">
                                <div className="flex justify-between items-center">
                                    <span className="text-gray-300">Meta diaria:</span>
                                    <span className="text-yellow-500">2500 kcal</span>
                                </div>
                                <div className="flex justify-between items-center">
                                    <span className="text-gray-300">Consumidas:</span>
                                    <span className="text-yellow-500">1800 kcal</span>
                                </div>
                                <div className="flex justify-between items-center">
                                    <span className="text-gray-300">Restantes:</span>
                                    <span className="text-yellow-500">700 kcal</span>
                                </div>
                                <div className="w-full bg-gray-700 rounded-full h-2.5 mt-4">
                                    <div className="bg-yellow-500 h-2.5 rounded-full" style={{ width: '72%' }}></div>
                                </div>
                            </div>
                        </div>
                    )}

                    {activeTab === 'tips' && (
                        <div className="space-y-4">
                            {nutritionTips.map((tip, index) => (
                                <div key={index} className="bg-gray-800 rounded-xl p-4">
                                    <p className="text-gray-300">{tip}</p>
                                </div>
                            ))}
                        </div>
                    )}
                </div>
            </div>
        </div>
    );
};

export default NutritionPage;
